import React from 'react';
import './styles.css';
import { Link } from 'react-router-dom';
import data from './data';
import GetMockData from './GetMockData'
import Button from '../../Button';

export class AllShoppingLists extends React.Component {
    showList = ({name, items, size}) => {
        <h2>{ name }</h2>
        alert("clicked")

    }

    render() {
        return(
            <section className="listoflists">
                <h1>Shopping Lists</h1>

                    {data.map(listName => (
                            <p><button onclick={this.showList}>
                                <GetMockData
                                    key={listName.name}
                                    name={listName.name}
                                />
                            </button></p>
                    ))}
                </section>
        );
    }

}
export default AllShoppingLists;
